import "./App.css";

export default function App() {
  return <div className="App"></div>;
}

const tests = [
  {
    name: "Test1",
    sections: {
      section1: {
        name: "Section 1",
        topics: [
          {
            name: "Topic 1",
            linkToSlides: "placeholder_link",
            suggestedProblems: [1, 2, 3],
          },
          {
            name: "Topic 2",
            linkToSlides: "placeholder_link",
            suggestedProblems: [4, 5, 6],
          },
        ],
      },
      section2: {
        name: "Section 2",
        topics: [
          {
            name: "Topic 3",
            linkToSlides: "placeholder_link",
            suggestedProblems: [7, 8, 9],
          },
          {
            name: "Topic 4",
            linkToSlides: "placeholder_link",
            suggestedProblems: [10, 11, 12],
          },
        ],
      },
    },
  },
  {
    name: "Test2",
    sections: {
      section1: {
        name: "Section 1",
        topics: [
          {
            name: "Topic 1",
            linkToSlides: "placeholder_link",
            suggestedProblems: [13, 14, 15],
          },
          {
            name: "Topic 2",
            linkToSlides: "placeholder_link",
            suggestedProblems: [16, 17, 18],
          },
        ],
      },
      section2: {
        name: "Section 2",
        topics: [
          {
            name: "Topic 3",
            linkToSlides: "placeholder_link",
            suggestedProblems: [19, 20, 21],
          },
          {
            name: "Topic 4",
            linkToSlides: "placeholder_link",
            suggestedProblems: [22, 23, 24],
          },
        ],
      },
    },
  },
];

function Tests() {
  return (
    <div>
      {tests.map((test) => {
        return <Test test={test} />;
      })}
    </div>
  );
}

function Test(test) {
  return (
    <div>
      <h1>{test.name}</h1>
      <Sections sections={test.sections} />
    </div>
  );
}
